import React from "react";
import Projects from "../../Components/Projects/projects";

function Gallery() {
  return (
    <div className="gallery">
      <h1>Application Gallery</h1>
      <div className="projects">
        <Projects />
      </div>
    </div>
  );
}

export default Gallery;
